import './App.css'
import React, { Component } from 'react'
import Customer from './components/Customer'

const customer = {
  name: '가나다라마바사아',
  birthday: '901111',
  gender: '남자',
  job: '대학생',
  image: 'https://placeimg.com/195/195/1',
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <Customer
          name={customer.name}
          birthday={customer.birthday}
          gender={customer.gender}
          job={customer.job}
          image={customer.image}
        />
      </div>
    )
  }
}

export default App
